Content:
@everyone 
Hey y'all! 
Hack School's coming up and we're looking for volunteers! In particular, we're looking for people to help answer any questions that people may have about the technologies we're teaching, so if you'd like to help out, fill out the form at https://acmurl.com/hacksquad, and also send your resume to my email (kshu@ucsd.edu)! Feel free to talk to me or Daniel if you have any questions!

@everyone Friendly reminder that we’ll be hosting a Setting Up Your Coding Environment Workshop today led by @nic. It’ll be happening at 6PM in the MPR (Next to Yogurt World / Price Center) and the workshop itself should only last about an hour or so! We’ll spend about half an hour just chilling and eating some pizza. Come by to set up your laptops for classes / projects.

ALSO I just ordered 21 pizzas so there’s a lot of food to go around 🍕

https://www.facebook.com/events/485821938862718/

@everyone

Thank you so so so much to so many of you for coming out to Kickoff and to the aftersocial! I can’t believe how many stayed several hours afterwards. I hope you all had a good time! 💙 💙 💙

For those looking for Kickoff content, just check out http://acmurl.com/links. This one link has all the information you need!

@everyone

:acm: ACM's Got Talent is going on tonight from 6-9 PM at Fung Auditorium! Come and support your fellow people as they share their passions with you!
There will be free food!

@everyone

2020-2021 Board applications are now open! It takes a lot of people in order to run an organization like ACM. Joining our team is a great way to give back to the community, build on your skillsets, and develop your resume. We'd love to have as many of you apply as possible!

View all the roles, information, and application links at https://acmurl.com/elections.

@everyone

Quick reminder that our Spring Kickoff is premiering tonight. Catch the video at our YouTube channel at <https://acmurl.com/youtube>. We'll be having a viewing party in the voice channels on Discord!

RSVP at https://acmurl.com/spring.
